	<script>
		layui.use(['element'], function() {
			
			const a4_Width = 595;
			const a4_Height = 841;
			
			const contentWidth = 1588;
			const contentHeight = 6944;
			
			// a4对应的实际大小
			var pageW = contentWidth;
			var pageH = contentWidth/a4_Width * a4_Height;
			
			console.log('pageW-', pageW, 'pageH-', pageH);
			
			var canvas = document.createElement('canvas');
			canvas.width = contentWidth;
			canvas.height = contentHeight;
			var ctx = canvas.getContext('2d');
			ctx.fillStyle = '#ffffff';
			var $img = $(".pdfImgAll img");
			console.log($img);
			// var imgW = $img.width();
			// var imgH = $img.height();
			ctx.drawImage($img[0], 0, 0, contentWidth, contentHeight);
			var base64 =  canvas.toDataURL('image/jpeg', 1.0);
			$('.pdfImgTest img').attr('src', base64);
			
			var pageList = [1056, 764, 1069];
			
			// 保存到电脑
			$(".btn-create").click(function() {
				
				// pdf对象
				var pdf = new jsPDF('', 'pt', 'a4');
				
				// 第一页
				var countH = 1056*2;
				var position = 0;
				// 获取指定区域图像数据[0, 1056*2]
				var imgData = ctx.getImageData(0, position, contentWidth, countH);
				var canvasZ = document.createElement('canvas');
				canvasZ.width = pageW;
				canvasZ.height = pageH;
				var ctxZ = canvasZ.getContext('2d');
				ctxZ.fillStyle = '#ffffff';
				ctxZ.fillRect(0, 0, canvasZ.width, canvasZ.height);
				ctxZ.putImageData(imgData, 0, 0);
				var pgData =  canvasZ.toDataURL('image/jpeg', 1.0);
				pdf.addImage(pgData, 'JPEG', 0, 0, a4_Width, a4_Height);
				pdf.addPage();
				position += countH;
				// $('.pdfImgTest').empty().append('<img src="'+ pgData +'">');
				
				// 第二页
				countH = 764*2;
				var imgData = ctx.getImageData(0, position, contentWidth, countH);
				var canvasZ = document.createElement('canvas');
				canvasZ.width = pageW;
				canvasZ.height = pageH;
				var ctxZ = canvasZ.getContext('2d');
				ctxZ.fillStyle = '#ffffff';
				ctxZ.fillRect(0, 0, canvasZ.width, canvasZ.height);
				ctxZ.putImageData(imgData, 0, 0);
				var pgData =  canvasZ.toDataURL('image/jpeg', 1.0);
				pdf.addImage(pgData, 'JPEG', 0, 0, a4_Width, a4_Height);
				pdf.addPage();
				position += countH;
				// $('.pdfImgTest').append('<img src="'+ pgData +'">');
				
				
				pdf.save('个人简历');
				
			})
			
			
		})
